import React, { Component } from "react";
import "../App.css";
import { Menu, Container, Button, Table, Form } from "semantic-ui-react";
import axios from 'axios';

export class HomePage extends Component {
    constructor(props) {
        super(props); //since we are extending class Table so we have to use super in order to override Component class constructor
        this.myRef = React.createRef();
        this.state = {
            new: "",
            returning: ""
        };

    }
    // Render the page
    render() {
        return (
            // Semantic UI stuff
            // Menu Section: Making the top menu
            // Container Section: The table menu
            <div className="homepage">
                <Menu color="blue" borderless attached inverted>
                    <Menu.Item header>PlanHub</Menu.Item>
                    <Menu.Menu position="right">
                        <Menu.Item name="Home" />
                        <Menu.Item name="How To" />
                        <Menu.Item name="Schedule" />
                    </Menu.Menu>
                </Menu>
                <Container textAlign="center">
                    <Container>
                        <Table>
                            <Form>
                                <Form.Group widths="equal">
                                    <Button type="submit" color="blue">
                                        New User
                                    </Button>
                                    <Button type="submit" color="blue">
                                        Returning User
                                     </Button>
                                </Form.Group>

                            </Form>
                        </Table>
                    </Container>
                </Container>
            </div>
        );
    }
}
